    true,nt"url": null,nt"notes": "<p>This series of on-line reports is based
    on the Adoption and Foster Care Analysis and Reporting System, and contain national
    data from FY 2003 through the most recent year available.  Information is provided
    on the national numbers of chldren in foster care, children who left foster care
    and the reasons for exit, including adoption.  Information on children waiting for
    adoption is also included.  Demographic data are provided, including race/ethnicity
    and age.</p>n",nt"license_title": "Other License Specified",nt"extras":
